Information
------------------------------

The Kangaroo King 
The scorching interior of the world's oldest continent is home to the toughest kangaroo on the planet, the mighty Red. You won't want to miss extremely rare footage of a red kangaroo birth and specialized in-pouch cameras that capture an intimate portrait of Red's development. We are also introduced to the kangaroo's formidable neighbours through close encounters with wedge-tailed eagles, dingoes, venomous snakes and giant monitor lizards. This is a story of survival against the odds and what it takes to endure drought, heat wave and bushfire.

